import { useCallback } from 'react';
import { Handle, Position } from 'reactflow';

function TextUpdaterNode({ data }) {
  const onChange = useCallback((evt) => {
    console.log(evt.target.value);
  }, []);

  return (
    <div style={{width: 165, background: 'linear-gradient(90deg, rgba(0,127,255,1) 0%, rgba(115,0,139,1) 100%)'}}>
      <div className="dataset-node">
        <div>
          <label htmlFor="text">Choose Dataset</label>
          <br />
          <select style={{width: 120, textAlign: 'center'}}>
            <option>IRIS Dataset</option>
            <option>MNIST Dataset</option>
          </select>
        </div>
        <Handle type="source" position={Position.Right} id="b"/>
      </div>
    </div>
  );
}

export default TextUpdaterNode;
